import { React, useState } from "react";
import Cards from "../../Components/Cards/cards";
import Cardbar from "../../Components/CardBar/cardbar";
import "./main.css";
import { Link } from "react-router-dom";
import Header from "../../Layout/Header/secondaryHeader";
import FilterIcn from "../../Assets/Icons/Filter";
import Filter from "../../Components/Filter/filter";
const Main = () => {
  const [filter, setFilter] = useState(false);
  const handleClick = () => {
    setFilter(!Filter);
    console.log("kello");
  };
  return (
    <div className="flex ">
      <div className=" mt-[12rem]   w-[20rem] items-start justify-center px-[4rem]  ">
        <div className=" ">
          <Filter Filter={filter} />
        </div>
        <span className="flex md:hidden  " onClick={handleClick}>
          <FilterIcn />
        </span>
      </div>
      <div className=" flex flex-col px-[20px] md:px-0 ">
        <Header />
        <div className=" mt-[5rem] flex flex-col gap-3">
          <Cardbar />
          <Cards />
        </div>
      </div>
    </div>
  );
};

export default Main;
